import OnboardingLayout from './OnboardingLayout';
import WeatherImageGrid from './WeatherImageGrid';
import BottomInputBar from './BottomInputBar';

export default function OnboardingStep1() {
  return (
    <OnboardingLayout progress="60%">
      <div className="px-4 space-y-4">
        <p className="text-xl font-semibold">
          거의 다 왔어요! <br />
          영이님이 좋아하는 날씨를 알려주세요.
        </p>
        <p className="text-sm text-gray-500">최대 10개까지 등록할 수 있어요. (3/10)</p>

        <WeatherImageGrid />

        <BottomInputBar />
      </div>
    </OnboardingLayout>
  );
}
